import { Button } from 'antd'
import React from 'react'
import Screen from '../../components/Screen/Screen';
import './Organigrama.scss';


export default function Organigrama() {

    
    return (
        <div className="square custom" >            
            <p><Button onClick={showMesage}>
                With extra props
            </Button></p>
            <Screen />
        </div>
    )
}

function showMesage(){
    alert('hola');
    let screen = document.getElementById("some-element");
    screen.setAttribute("style", "display: null;");
}
